import './App.css';
import MovieList from './Movie/MovieList';
import Filtre from './Filtre/Filtre';
import React,{useState,useEffect} from 'react';
import Ajouter from './ajouter/ajouter';
import {BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Trailer from './Movie/trailer';
import Header from './Header/Header';




function App() {

 


  

 const [Movies,setMovies]=useState([
  
  {
    id: 1,
    title: 'See',
    description:'Set in a near future where humans have lost their sense of sight, relying on techniques that were new to conduct life. When a pair of twins is born which have their own sight Matters get thrown into chaos. ',
    posterURL: 'https://flxt.tmsimg.com/assets/p17602423_b_v8_ac.jpg',
    trailerURL:"https://youtu.be/7Rg0y7NT1gU",
    rating: 4
  },

  {
    id: 2,
    title: 'TIRAILLEURS',
    description: 'Description ',
    posterURL: "data:image/jpeg;base64,",
    trailerURL:"https://www.youtube.com/watch?v=PGo4wfCejsk&t=19s",
    rating: 4.5
  },
  {
    id: 3,
    title: 'Fast & Furious',
    description: 'Description ',
    posterURL: 'https://fr.web.img3.acsta.net/c_310_420/pictures/23/05/10/10/55/5129031.jpg',
    trailerURL:"https://youtu.be/BU3e8cTsojc",
    rating: 5
  },
  {
    id: 4,
    title: 'CHATRAPATHI',
    description: 'Description ',
    posterURL: "data:image/jpeg;base64,",
    trailerURL:"https://youtu.be/BU3e8cTsojc",
    rating: 7.8
  },
])

    
  

  const AddMovie =(newmovie)=>{
    const updateMovies=[...Movies,newmovie]
     setMovies(updateMovies);

    localStorage.setItem('Movies',JSON.stringify(updateMovies));
  };

  useEffect(()=>{
 const storedMovies=localStorage.getItem('Movies');
 if(storedMovies){
  setMovies(JSON.parse(storedMovies));
 }

 

},[])


  return (


<Router>
    <div className="App">  
       <Header/>
       <Filtre Movies={Movies} setMovies={setMovies} />
      <Routes>
        <Route path='/ajouter' element={<Ajouter  AddMovie={AddMovie}/>}/>
      <Route  exact path='/'  element={<MovieList Movies={Movies}  setMovies={setMovies}  />}/>
      <Route exact path='/trailer/:title'   element={<Trailer Movies={Movies}/>}/>
      </Routes>
      
      
    </div>
  </Router>
  );
}

export default App;
